import React, { ReactElement } from "react";
// import { Controls } from "../components/musicPlayer";

const MusicPlayer: React.FC = (): ReactElement => (
  <div
    style={{
      display: "block",
      margin: 0,
      position: "absolute",
      backgroundColor: "black",
      height: "100%",
      width: "100%",
      color: "white",
      fontFamily: "'Work Sans', sans-serif",
      fontSize: "18px"
    }}
  >
    <div
      style={{
        height: "5%",
        width: "80%",
        backgroundColor: "#333",
        textAlign: "center",
        padding: "15% 10% 5% 10%"
      }}
    >
      <div style={{ fontSize: "24px" }}>NOW PLAYING</div>
      <div style={{ fontSize: "48px" }}>Benjamin Something - Something, something, something a new start</div>
    </div>

    <div
      style={{
        height: "10%",
        width: "100%",
        backgroundColor: "#333",
        position: "absolute",
        bottom: 0
      }}
    >
      <div>NOW PLAYING</div>
      <div>ARTIST - SONG NAME</div>
    </div>
  </div>
);

export default MusicPlayer;
